import axios from 'axios'

const Admin = () => {

  const logOut = (e: any) => {
    e.preventDefault()

    axios.get('http://localhost:8000/api/log')

  }

  return (
    <>
      <h2>Admin</h2>
      <div>
        <button onClick={logOut} className='btn btn-danger'>Logout</button>
      </div>
    </>
  )
}

export default Admin
